import React from 'react';

const Contact = () => {
  return (
    <div>
      <h1>Contact Me</h1>
      <p>Email: ravikumarrk45211@gmail.com</p>
      <p>Phone: +91 6205389480</p>
      <p>Date of Birth: January 10, 2003</p>
    </div>
  );
};

export default Contact;
